// react
import React, { Component, Fragment } from "react";

// third part
import { Layout, Menu } from "antd";

// custom
import "../assets/css/style.css";
import Breakfast from "../assets/icons/Breakfast";
import Personal from "../assets/icons/Personal";
import TableInfo from "../assets/icons/Table_Info";

const { Header, Content, Footer, Sider } = Layout;

export default class AdminBoard extends Component {
  state = {
    collapsed: false
  };

  onCollapse = collapsed => {
    console.log(collapsed);
    this.setState({ collapsed });
  };

  render() {
    return (
      <Fragment>
        <Layout style={{ minHeight: "100vh" }}>
          <Sider
            collapsible
            collapsed={this.state.collapsed}
            onCollapse={this.onCollapse}
          >
            <div style={{ background: "#000000", height: "50px", margin: "0" }}>
              <div className="logo" />
            </div>
            <Menu theme="light" defaultSelectedKeys={["1"]} mode="inline">
              <Menu.Item key="1">
                <Breakfast />
                <span className="menu-title">Dish information</span>
              </Menu.Item>
              <Menu.Item key="2">
                <Personal />
                <span className="menu-title">Personal Information</span>
              </Menu.Item>

              <Menu.Item key="9">
                <TableInfo />
                <span className="menu-title">Table Information</span>
              </Menu.Item>
            </Menu>
          </Sider>
          <Layout>
            <Header style={{ background: "#000000", padding: 0 }} />
            <Content style={{ margin: "2em 16px" }}>
              <div style={{ padding: 24, background: "#fff", minHeight: 360 }}>
                Bill is a cat.
              </div>
            </Content>
            <Footer style={{ textAlign: "center" }}>
              Ant Design ©2018 Created by Ant UED
            </Footer>
          </Layout>
        </Layout>
      </Fragment>
    );
  }
}
